import React from "react";
import { useState } from "react";
import axios from "axios";

const Edit = (props) => {
  const [newName, setNewName] = useState({ ...props.breweries.name });
  const [newBrewery_type, setNewBrewery_type] = useState({ ...props.breweries.brewery_type });
  const [newAddress, setNewAddress] = useState({ ...props.breweries.street });
  const [newCity, setNewCity] = useState({ ...props.breweries.city });
  const [newState, setNewState] = useState({ ...props.breweries.state });
  const [newWebsite, setNewWebsite] = useState({ ...props.breweries.website_url });

  const handleNameUpdate = (event) => {
    setNewName(event.target.value);
  };
  const handleBrewery_typeUpdate = (event) => {
    setNewBrewery_type(event.target.value);
  };
  const handleAddressUpdate = (event) => {
    setNewAddress(event.target.value);
  };
  const handleCityUpdate = (event) => {
    setNewCity(event.target.value);
  };
  const handleStateUpdate = (event) => {
    setNewState(event.target.value);
  };
  const handleWebsiteUpdate = (event) => {
    setNewWebsite(event.target.value);
  };
//-----------------------------------
//              UPDATE BREWERY
//-----------------------------------

  const handleEdit = (event) => {
    event.preventDefault()
        axios.put(`http://localhost:3000/breweries/${props.brewery._id}`,
            {
                name: newName,
                brewery_type: newBrewery_type,
                address: newAddress,
                city: newCity,
                state: newState,
                website_url: newWebsite
            }
        ).then(() => {
          props.setEdit(false)
          props.getBreweries()
        })
  }



  const handleSubmit = (event) => {
    event.preventDefault();
    props.handleEdit();
  };

  return (
    <>
        <form id="editForm" onSubmit={handleEdit}>
          <label htmlFor="name">Name:</label>
          <input type="text" name="name" placeholder={props.brewery.name} onChange={handleNameUpdate} />
          <br />
          <br />
          <label htmlFor="name">Type:</label>
          <input type="text" name="brewery_type" placeholder={props.brewery.brewery_type} onChange={handleBrewery_typeUpdate} />
          <br />
          <br />
          <label htmlFor="name">Street:</label>
          <input type="text" name="street"placeholder={props.brewery.street}  onChange={handleAddressUpdate} />
          <br />
          <br />
          <label htmlFor="name">City:</label>
          <input type="text" name="city" placeholder={props.brewery.city} onChange={handleCityUpdate} />
          <br />
          <br />
          <label htmlFor="name">State:</label>
          <input type="text" name="state" placeholder={props.brewery.state} onChange={handleStateUpdate} />
          <br />
          <br />
          <label htmlFor="name">Web:</label>
          <input type="text" name="website_url" placeholder={props.brewery.website_url} onChange={handleWebsiteUpdate} />
          <br />
          <br />
          <input id="editBtn" type="submit" onSubmit={handleSubmit}/>
          <button id="editBtn" onClick={() => { props.toggleEdit() }}>Cancel</button>
          <button id="editBtn" onClick={() => { props.handleDelete(props.brewery) }}>Delete</button>
        </form>
    </>
  );
};

export default Edit;
